      summary: "A man is turned into a beast as punishment for being mean to others",
      stars: 5,
      review: []
    }
  ];


export default function Movie() {
    return (
        <div>
            {movieDetails.map(Movie => <div>{MovieList}</div>)}
        </div>
    )
}
